INSERT INTO `skill_news` VALUES (1, 'Thiên lôi điện trảm', 'Dùng sức mạnh của sấm sét tấn công nhiều mục tiêu trong 1 phạm vi nhất định', 6, 0, 60000);
INSERT INTO `skill_news` VALUES (2, 'Sấm động dương gian', ' Dùng vũ khí làm cầu nối dẫn truyền sấm sét vào cơ thể đối thủ, tia sét sẽ di chuyển thành một chuỗi liên hoàn vào các đối tượng tập trung gần nhau.', 7, 0, 120000);
INSERT INTO `skill_news` VALUES (3, 'Kiếm phi kinh thiên', 'Vận kình lực tạo thành những thanh kiếm khổng lồ giáng từ trên trời xuống đối phương', 8, 0, 300000);
INSERT INTO `skill_news` VALUES (4, 'Thiên long bạo kích', 'Dùng sức mạnh của rồng lửa tấn công nhiều mục tiêu trong 1 phạm vi nhất định', 6, 1, 60000);
INSERT INTO `skill_news` VALUES (5, 'Liệt hỏa bạo kích', 'Vận nội kình tạo ra liệt hỏa phát tán ra xung quanh, đốt cháy bất kỳ đối tượng nào trên đường đi của liệt hỏa.', 7, 1, 120000);
INSERT INTO `skill_news` VALUES (6, 'Sao băng giáng thế', ' Khuấy động bầu trời, tạo ra những cơn mưa sao băng trút xuống mặt đất', 8, 1, 300000);
INSERT INTO `skill_news` VALUES (7, 'Hải long xuất thế', 'Dùng sức mạnh của rồng nước tấn công nhiều mục tiêu trong 1 phạm vi nhất định', 8, 2, 60000);
INSERT INTO `skill_news` VALUES (8, 'Song long thị uy', ' Vận nội kình vào hai tay đánh ra hai con rồng theo hình trôn ốc, tạo nên một lực công phá khủng khiếp.', 9, 2, 120000);
INSERT INTO `skill_news` VALUES (9, 'Hàn băng vũ', ' Gọi gió hô mưa rồi truyền vào đó một luồng hàn băng cực mạnh tạo nên những trận mưa băng khủng khiếp', 10, 2, 300000);
INSERT INTO `skill_news` VALUES (10, 'Kinh thiên động địa', 'Tạo ra những cơn địa chấn tấn công nhiều mục tiêu trong phạm vi nhất định', 6, 3, 60000);
INSERT INTO `skill_news` VALUES (11, 'Sơn Tinh bộ thiên', 'Dùng búa tạo ra những trận mưa đá tảng tấn công tới tấp vào đối thủ.', 7, 3, 120000);
INSERT INTO `skill_news` VALUES (12, 'Thạch nhũ công tâm', 'Giáng một búa mạnh xuống đất tạo nên những cột thạch nhũ lao lên khỏi mặt đất công kích đối phương', 8, 3, 300000);
INSERT INTO `skill_news` VALUES (13, 'Thập diện tâm tiễn', 'Tẩm cực độc vào mũi tên và triệt hạ nhiều mục tiêu cùng lúc', 6, 4, 60000);
INSERT INTO `skill_news` VALUES (14, 'Thăng thiên loạn tiễn', 'Hất tung đối phương lên không trung và bắn liên hoàn năm mũi tên vào đối thủ dẫn đến tử vong.', 7, 4, 120000);
INSERT INTO `skill_news` VALUES (15, 'Vạn tiễn quy tâm', 'Mo ta skill moi', 8, 4, 300000);
